import { Divider } from '@mui/material';
import React from 'react'
import Top from '../Top';
import './Contact.css';

function Login() {
  return (
    <>
      <Top/>
      <div className='contact-back'>
          <h1>
            <center>
              GET IN TOUCH
            </center>
          </h1>
          <Divider variant="middle" sx={{borderBottomWidth: 4, marginLeft: '7%', marginRight: '7%'}}/>
      </div>
    </>
  )
}

export default Login;
